동현: 이 c 8로마
길수: 나 c 7놈인데
동현: 유감;;

김판섭 쟤는 너무 얍삽함;
온갖 쎈척은 다하면서 일단 부하들로 다굴빵 시키고,
애들 모자라니까 더보내달라는 것좀 봐;;
맨날 자기가 밟아주네 어쩌네 하면서 결국 또
다른놈이 처리해줬으면 좋겠는지 여유있는척하지만 또 피함
쟤는 진짜 저러다가 김구한테 개털리는 전개로 갈것같다.

매드맥스 가 더 쌔지는 이유는
정신줄 놓고 그냥 풀파워로 싸우는것이 아닌 
맞는거 신경안쓰고 계속 풀파워로 싸운다는거임;

강동현이 김구의 기술이름(정의구현 크래쉬)을 생각하는걸 보니.. 
저거 때릴때마다 김구가 기술이름을 말하면서 때리는건가? 
어차피 그냥 주먹질일 뿐인데.. 말로안하면 딱히 구분 안될텐데..;;

동현이 신발 구찌라이톤 100마넌
소희 신발 발렌시아가 트리플에스 멀티 160마넌
소희 셔츠 발렌시아가 패딩셔츠블루 100마넌...;

근데 생각해본건데 박철권은 3학년이구
레인메이커애들은 2학년이니깐 졸업 하면 그때 치면 레인메이커가 걍 바르지 않나;;
왜 생각을 못하지;;

러브라인 싫어요
이 만화가 로맨스물도 아닌데..;;
